import * as assert from 'assert'
import { pipe } from 'fp-ts/lib/function'
import { parse, pow, toString, RoundingOptions } from '../src/Big'

function testPow(expectedResult: string, x: string | number, exp: number, ro: RoundingOptions) {
  it(`Big.js test: ${x} ^^ ${exp}`, () => {
    assert.strictEqual(pipe(x, parse, pow(exp, ro), toString), expectedResult)
  })
}

